import ThesesChart from './components/ThesesChart';
import myData from './utils/adata.json';
import {useState} from 'react';

function App() {

  const [chartData,setChartData] = useState({

      labels: myData.map((item)=>{
        return item.year;
      }),
      datasets: [
        //RUG
          {
            label: 'RUG',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(75,192,192,1)',
            borderColor: 'rgba(75,192,192,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.RUG >= 10;
            })
          },
        //UvA
          {
            label: 'UVA',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(70,130,180,1)',
            borderColor: 'rgba(70,130,180,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.UVA >= 10;
            })
          },
        //RU
          {
            label: 'RU',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(85,107,47,1)',
            borderColor: 'rgba(85,107,47,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.RU >= 10;
            })
          },
        //VU
          {
            label: 'VU',
