            borderColor: 'rgba(147,112,219,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.VU >= 10;
            })
          },
        //TUD
          {
            label: 'TUD',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(220,20,60,1)',
            borderColor: 'rgba(220,20,60,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.TUD >= 10;
            })
          },
        //TUE
          {
            label: 'TUE',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(138,43,226,1)',
            borderColor: 'rgba(138,43,226,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.TUE >= 10;
            })
          },
        //WUR
          {
            label: 'WUR',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(0,0,205,1)',
            borderColor: 'rgba(0,0,205,1)',
            borderWidth: 2,
            data: myData.filter((item)=>{
              return item.WUR >= 10;
            })
          },
        //EUR
          {
            label: 'EUR',
