            borderColor: 'rgba(0,128,128,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.EUR;
            })
          },
        //UU
          {
            label: 'UU',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(0,250,154,1)',
            borderColor: 'rgba(0,250,154,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.UU;
            })
          },
        //LU
          {
            label: 'LU',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(0,255,0,1)',
            borderColor: 'rgba(0,255,0,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.LU;
            })
          },
        //UM
          {
            label: 'UM',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(255,215,0,1)',
            borderColor: 'rgba(255,215,0,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.UM;
            })
          },
        //UT
          {
            label: 'UT',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(255,69,0,1)',
            borderColor: 'rgba(255,69,0,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.UT;
            })
          },
        //UvT
          {
            label: 'UvT',
            fill: true,
            lineTension: 0.5,
            backgroundColor: 'rgba(240,128,128,1)',
            borderColor: 'rgba(240,128,128,1)',
            borderWidth: 2,
            data: myData.map((item)=>{
              return item.UvT;
            })
          },

        ]
  });


  return (
   <ThesesChart chartData={chartData}/>
  );
}

export default App;
